{'personal_info': {'name': 'Kristina Shen', 'headline': 'General Partner at Andreessen Horowitz', 'company': None, 'school': None, 'location': 'San Francisco, California', 'summary': 'Kristina joined the firm in 2013 with a focus on the cloud-computing and internet sectors. Kristina is involved in Bessemer’s investments in Adaptive Insights, ClearCare, DoubleDutch, Gainsight, Instructure, ServiceTitan, Speakeasy, Twilio and Vidyard. She is a Board Observer for ClearCare, DoubleDutch, Instructure, Retail Solutions, ServiceTitan and Vidyard, and a co-founder and board member for SpeakEasy. With Byron Deeter, Kristina co-authors Bessemer’s State of the Cloud Report, which captures the top trends among leading public and private cloud computing and enterprise mobile companies. The pair also produces Bessemer’s Cloud Index, which tracks the top public cloud computing companies, and is used by major media outlets, analysts and thought leaders to understand the health of the sector. An expert in the field, Kristina’s contributions to Bessemer and the startup ecosystem earned her a slot in Business Insider’s 2014 “30 and Under” list of Rising Stars who find Hot Startup Deals in Silicon Valley.Before joining Bessemer, Kristina worked in the finance world as an investor at JMI Equity, and investment banker at both Goldman Sachs and Credit Suisse. Her experience includes working on the IPOs of Palo Alto Networks, Zynga, Fusion-io and Infoblox, as well as the sale of Q1 Labs to IBM and Goldman Sachs’ investment in Kno, Inc. Kristina graduated with a B.A. in Operations Research and Management Science from UC Berkeley.', 'image': '', 'followers': '3,663', 'email': None, 'phone': None, 'connected': None, 'websites': [], 'current_company_link': 'https://www.linkedin.com/company/andreessen-horowitz/'}, 'experiences': {'jobs': [{'title': 'General Partner', 'company': 'Andreessen Horowitz', 'date_range': 'Dec 2019 – Present', 'location': None, 'description': None, 'li_company_url': 'h