      Writings & podcasts: http://www.jonlai.co/', 'image': '', 'followers': '3,470', 'email': None, 'phone': None, 'connected': None, 'websites': ['http://www.jonlai.co', 'http://www.tencent.com'], 'current_company_link': 'https://www.linkedin.com/company/andreessen-horowitz/'}, 'experiences': {'jobs': [{'title': 'Investment Partner', 'company': 'Andreessen Horowitz', 'date_range': '2019 – Present', 'location': 'Menlo Park, CA', 'description': "A few investment themes I'm excited about:- Games as the next social network (next-gen studios, emerging platforms)- New media frontiers (interactivity applied to linear media, online to offline, livestreaming)- 'Gamerization' of the enterprise (SaaS / productivity tools designed by gamers)- EdTech innovation (AI in education, edutainment, self-help)Board observer on: Mainframe Industries (A), Singularity 6 (A), Super Evil Megacorp (A), Carbonated (A), Odyssey Interactive (Seed), One More Game (Seed), Elodie (Seed) & more unannounced", 'li_company_url': 'https://www.linkedin.com/company/andreessen-horowitz/'}, {'title': 'Senior Director, Business Development', 'company': 'Tencent', 'date_range': '2015 – 2019', 'location': 'Palo Alto, CA', 'description': "Led the North America publishing & investments team for the world's largest video game publisher- Investments: Epic Games, Discord, Proletariat, Red Hook, InXile, Stoic Studio, & many more- Games published: Don't Starve, Slay the Spire, Hollow Knight, Firewatch, Pyre, & many more- Spearheaded the launch of WeGame, Tencent's premium Western games platform (>20M MAU)", 'li_company_url': 'https://www.linkedin.com/company/tencentglobal/'}, {'title': 'Senior Product Manager', 'company': 'Riot Games', 'date_range': '2012 – 2015', 'location': 'Santa Monica, CA', 'description': 'Producer for studio behind League of Legends (acquired by Tencent).  Products shipped:- Riot developer platform and API (http://developer.riotgames.com)- Riot eCommerce store (http://merch.riotgames.com)- Virtual currency platform (http://nyti.ms/1BvsofU)', 'li_company_url': 'https://www.linkedin.com/company/riot-games/'}, {'title': 'Venture Capital Associate', 'company': 'Crosslink Capital', 'date_range': '2008 – 2010', 'location': 'San Francisco, CA', 'description': 'Digital media and SaaS investments for a $1.8B growth equity fund. Deals include: Pandora (IPO), Carbonite (IPO), Hi5 (acquired)', 'li_company_url': 'https://www.linkedin.com/company/crosslink-capital/'}, {'title': 'Investment Banking Analyst', 'company': 'Morgan Stanley', 'date_range': '2006 – 2008', 'location': 'Menlo Park, CA', 'description': 'Corporate finance / M&A advisory for technology companies.  Deals include: Mubadala $622M investment in AMD, McAfee $350M acquisition of SafeBoot, Netezza $134M IPO', 'li_company_url': 'https://www.linkedin.com/company/morgan-stanley/'}], 'education': [{'name': 'Harvard University', 'degree': 'A.B.', 'grades': None, 'field_of_study': 'Economics and Computer Science', 'date_range': None, 'activities': None}, {'name': 'Harvard Business School', 'degree': 'MBA', 'grades': None, 'field_of_study': 'Business Administration', 'date_range': None, 'activities': None}], 'volunteering': [{'title': 'Chapter Leader (San Francisco & Boston)', 'company': 'Acumen', 'date_range': '2009 – 2011', 'location': None, 'cause': 'Poverty Alleviation', 'description': 'Co-founded the SF chapter of the Acumen Fund, a social venture capital fund that uses entrepreneurship to address poverty. Grew SF chapter from 5 to 180+ members and raised over $18,000 in funding. Launched Boston chapter and grew membership from 2 to 60+ people.'}]}, 'skills': [{'name': 'Product Management', 'endorsements': '30'}, {'name': 'Venture Capital', 'endorsements': '20'}, {'name': 'Mobile Devices', 'endorsements': '9'}, {'name': 'Business Development', 'endorsements': '8'}, {'name': 'Cross-functional Team Leadership', 'endorsements': '7'}, {'name': 'Financial Analysis', 'endorsements': '5'}, {'name': 'Strategic Pl